import React from 'react';
import "./Header.css"
import { IoMenu } from "react-icons/io5";


const Hamburger = ({hamburgerOpen}) => {
  return (
    <div className='hamburger'>
      {hamburgerOpen}
        <IoMenu />

    </div>
  )
}

export default Hamburger;
